import React, { useState, useEffect, useRef } from 'react';
import './App.css';
import StrategyHeatmap from './components/StrategyHeatmap';
import ScoreChart from './components/ScoreChart';
import MarketSection from './components/MarketSection';

function App() {
  const [environment, setEnvironment] = useState('prod');
  const [marketData, setMarketData] = useState({});
  const [scoreHistory, setScoreHistory] = useState([]);
  const [connectionStatus, setConnectionStatus] = useState('DISCONNECTED');
  const [lastUpdate, setLastUpdate] = useState(null);
  const wsRef = useRef(null);

  const websocketUrl = environment === 'local' 
    ? 'ws://localhost:8765' 
    : 'ws://134.209.184.5:8765';

  useEffect(() => {
    const connect = () => {
      if (wsRef.current) {
        wsRef.current.close();
      }

      console.log(`ðŸ”Œ Connecting to ${websocketUrl}`);

      try {
        const ws = new WebSocket(websocketUrl);

        ws.onopen = () => {
          console.log('âœ… Connected successfully!');
          setConnectionStatus('Connected');
          ws.send(JSON.stringify({ type: 'get_latest' }));

          // Periodic requests every 5 seconds
          const interval = setInterval(() => {
            if (ws.readyState === WebSocket.OPEN) {
              ws.send(JSON.stringify({ type: 'get_latest' }));
            }
          }, 5000);

          ws.interval = interval;
        };

        ws.onmessage = (event) => {
          try {
            const data = JSON.parse(event.data);
            console.log('ðŸ“¦ Received data with keys:', Object.keys(data));
            console.log('ðŸ“‹ Full data structure:', data);

            if (data.type === 'pong') return;

            // Check for different data structures
            if (data.data) {
              console.log('ðŸ” Found data.data with keys:', Object.keys(data.data));
              if (data.data.signals_by_tag_and_direction_and_market) {
                console.log('âœ… Found heatmap data in data.data');
              }
            }

            if (data.signals_by_tag_and_direction_and_market) {
              console.log('âœ… Found heatmap data at root level');
            }

            // Store the complete data object
            setMarketData(data);
            setLastUpdate(new Date());

            // Update score history for chart
            updateScoreHistory(data);

          } catch (error) {
            console.error('âŒ Error processing data:', error);
          }
        };

        ws.onerror = (error) => {
          console.error('âŒ WebSocket error:', error);
          setConnectionStatus('ERROR');
        };

        ws.onclose = (event) => {
          console.log('ðŸ”Œ WebSocket closed:', event.code);
          setConnectionStatus('DISCONNECTED');
          if (ws.interval) clearInterval(ws.interval);

          // Reconnect after delay
          setTimeout(() => {
            connect();
          }, 5000);
        };

        wsRef.current = ws;
      } catch (error) {
        console.error('âŒ Failed to connect:', error);
        setConnectionStatus('ERROR');
      }
    };

    connect();

    return () => {
      if (wsRef.current) {
        if (wsRef.current.interval) {
          clearInterval(wsRef.current.interval);
        }
        wsRef.current.close();
      }
    };
  }, [websocketUrl]);

  const updateScoreHistory = (data) => {
    // Extract score data from the received data
    if (data.data && data.data.signals_by_market && data.data.signals_by_market.NQ) {
      const nqData = data.data.signals_by_market.NQ;
      console.log('ðŸ“Š NQ Data for score calculation:', nqData);

      const longScore = nqData.Long?.final_score || 0;
      const shortScore = nqData.Short?.final_score || 0;
      const netScore = longScore - shortScore;

      console.log('ðŸ“ˆ Score calculation:', {
        longScore,
        shortScore,
        netScore,
        longData: nqData.Long,
        shortData: nqData.Short
      });

      setScoreHistory(prev => {
        const newEntry = {
          timestamp: new Date(),
          score: netScore,
          longScore,
          shortScore
        };

        const newHistory = [...prev, newEntry];

        // Keep only last 5 minutes of data
        const fiveMinutesAgo = new Date(Date.now() - 5 * 60 * 1000);
        return newHistory.filter(item => item.timestamp > fiveMinutesAgo);
      });
    } else {
      console.log('âŒ No NQ data found for score calculation');
      console.log('ðŸ” Available data structure:', {
        hasData: !!data.data,
        hasSignalsByMarket: !!data.data?.signals_by_market,
        marketKeys: data.data?.signals_by_market ? Object.keys(data.data.signals_by_market) : 'none'
      });
    }
  };

  const formatTime = (date) => {
    if (!date) return '--:--:--';
    return date.toLocaleTimeString();
  };

  return (
    <div className="app">
      <header className="app-header">
        <h1>ImpViz Active Trader</h1>
        <div className="connection-info">
          <div className={`status-indicator ${connectionStatus.toLowerCase()}`}>
            <span className="status-dot"></span>
            <span>{connectionStatus}</span>
          </div>
          <div className="last-update">
            Last Update: {formatTime(lastUpdate)}
          </div>
          <button 
            className="env-toggle"
            onClick={() => setEnvironment(env => env === 'prod' ? 'local' : 'prod')}
          >
            {environment === 'prod' ? 'Production' : 'Local'}
          </button>
        </div>
      </header>

      {/* Strategy Metrics Heatmap */}
      <StrategyHeatmap data={marketData} />

      {/* Score Trend Chart */}
      <ScoreChart scoreHistory={scoreHistory} />

      {/* Market Data Section */}
      <MarketSection data={marketData} />
    </div>
  );
}

export default App;
